import { Box } from '@mui/system'
import React from 'react'
import EarningCard from '../../components/card/CardTest'

// CSS
import styles from './Home.module.css'

const Home = () => {
    return (
        <div style={styles}>
            <h1>Home</h1>
            <Box sx={{ width: 100 }}>
                <EarningCard />
            </Box>
        </div>
    )
}

export default Home
